import React from 'react';

const unOrList: any = () =>{
    return (
        <ul>
            <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
        </ul>
    );
}

const App = (): any => {
  return (
    <div>
      unOrList();
    </div>
  );
}

export default App;
